import React, { useState } from "react";

const SignUpForm = () => {
  const [focus, setFocus] = useState({
    username: false,
    email: false,
    password: false,
    confirmPassword: false,
  });

  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);
  const [usernameTaken, setUsernameTaken] = useState("");
  const [passwordError, setPasswordError] = useState("");
  const [emailError, setEmailError] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [usernameLoading, setUsernameLoading] = useState(false);

  // Check if username is available
  const checkUsernameAvailability = async (username) => {
    setUsernameTaken("");
    setUsernameLoading(true);
    if (username.length === 0) return;
    try {
      const response = await fetch(`http://localhost:5000/api/check-username?username=${username}`);
      const data = await response.json();
      if (data.taken) {
        setUsernameTaken("Username is already taken");
      } else {
        setUsernameTaken("Username is available");
      }
    } catch (error) {
      console.error('Fetch error:', error);
      setUsernameTaken("Error checking username");
    }
    setUsernameLoading(false);
  };

  // Password validation
  const validatePassword = (password) => {
    if (password.length < 6) {
      setPasswordError("Password must be at least 6 characters long.");
    } else if (!/[A-Z]/.test(password)) {
      setPasswordError("Password must contain at least one uppercase letter.");
    } else if (!/\d/.test(password)) {
      setPasswordError("Password must contain at least one number.");
    } else {
      setPasswordError("");
    }
  };

  // Email validation
  const validateEmail = (email) => {
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setEmailError("Invalid email format.");
    } else {
      setEmailError("");
    }
  };

  // Handle form submission
  const handleSubmit = async (event) => {
    event.preventDefault();
    setLoading(true);
    if (!email || !username || !password || !confirmPassword) {
      alert("Please fill in all fields.");
      setLoading(false);
      return;
    }
    if (password !== confirmPassword) {
      alert("Passwords do not match");
      setLoading(false);
      return;
    }

    const formData = { username, password, email };

    try {
      const response = await fetch("http://localhost:5000/api/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error("Failed to register, please try again.");
      }

      const data = await response.json();
      if (data.message) {
        alert(data.message);
      }

      setLoading(false);
    } catch (error) {
      console.error("Error registering user:", error);
      alert(error.message || "Error registering user. Please try again.");
      setLoading(false);
    }
  };

  return (
    <div style={{ backgroundImage: "url('lbg.png')", backgroundSize: "cover", backgroundPosition: "center", backgroundAttachment: "fixed", height: "100%", width: "100%" }}>
      <div style={{ display: "flex", justifyContent: "center", alignItems: "center", padding: "20px", minHeight: "100vh" }}>
        <div style={{ background: "rgba(255, 255, 255, 0.7)", backdropFilter: "blur(10px)", WebkitBackdropFilter: "blur(0px)", borderRadius: "10px", padding: "25px", boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)", width: "100%", maxWidth: "400px" }}>
          <form onSubmit={handleSubmit}>
            <h2 style={{ textAlign: "center", color: "#363100", fontSize: "2rem", marginBottom: "20px" }}>CUISINING</h2>

            {/* Email Field */}
            <div style={{ position: "relative", marginBottom: "20px" }}>
              <label style={{ position: "absolute", left: "10px", top: focus.email ? "-10px" : "50%", fontSize: focus.email ? "12px" : "16px", color: "#363100", transition: "all 0.3s ease", transform: focus.email ? "translateY(0)" : "translateY(-50%)", padding: "0 5px" }}>
                Email
              </label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                style={{ width: "100%", padding: "10px", border: "1px solid transparent", borderRadius: "10px", outline: "none", backgroundColor: "#f8f8f8", transition: "all 0.3s ease", ...(focus.email && { border: "1px solid #C1B857", boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)", backgroundColor: "#fff" }) }}
                onFocus={() => setFocus({ ...focus, email: true })}
                onBlur={(e) => validateEmail(e.target.value)}
              />
            </div>

            {/* Username Field */}
            <div style={{ position: "relative", marginBottom: "20px" }}>
              <label style={{ position: "absolute", left: "10px", top: focus.username ? "-10px" : "50%", fontSize: focus.username ? "12px" : "16px", color: "#363100", transition: "all 0.3s ease", transform: focus.username ? "translateY(0)" : "translateY(-50%)", padding: "0 5px" }}>
                Username
              </label>
              <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                style={{ width: "100%", padding: "10px", border: "1px solid transparent", borderRadius: "10px", outline: "none", backgroundColor: "#f8f8f8", transition: "all 0.3s ease", ...(focus.username && { border: "1px solid #C1B857", boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)", backgroundColor: "#fff" }) }}
                onFocus={() => setFocus({ ...focus, username: true })}
                onBlur={() => checkUsernameAvailability(username)}
              />
              {usernameTaken && <span style={{ color: "red", fontSize: "12px" }}>{usernameTaken}</span>}
            </div>

            {/* Password Field */}
            <div style={{ position: "relative", marginBottom: "20px" }}>
              <label style={{ position: "absolute", left: "10px", top: focus.password ? "-10px" : "50%", fontSize: focus.password ? "12px" : "16px", color: "#363100", transition: "all 0.3s ease", transform: focus.password ? "translateY(0)" : "translateY(-50%)", padding: "0 5px" }}>
                Password
              </label>
              <input
                type={showPassword ? "text" : "password"}
                value={password}
                onChange={(e) => { setPassword(e.target.value); validatePassword(e.target.value); }}
                style={{ width: "100%", padding: "10px", border: "1px solid transparent", borderRadius: "10px", outline: "none", backgroundColor: "#f8f8f8", transition: "all 0.3s ease", ...(focus.password && { border: "1px solid #C1B857", boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)", backgroundColor: "#fff" }) }}
                onFocus={() => setFocus({ ...focus, password: true })}
                onBlur={() => setFocus({ ...focus, password: false })}
              />
              <button type="button" onClick={() => setShowPassword(!showPassword)} style={{ position: "absolute", right: "10px", top: "50%", transform: "translateY(-50%)", background: "none", border: "none", cursor: "pointer" }}>
                {showPassword ? "Hide" : "Show"}
              </button>
              {passwordError && <span style={{ color: "red", fontSize: "12px" }}>{passwordError}</span>}
            </div>

            {/* Confirm Password Field */}
            <div style={{ position: "relative", marginBottom: "20px" }}>
              <label style={{ position: "absolute", left: "10px", top: focus.confirmPassword ? "-10px" : "50%", fontSize: focus.confirmPassword ? "12px" : "16px", color: "#363100", transition: "all 0.3s ease", transform: focus.confirmPassword ? "translateY(0)" : "translateY(-50%)", padding: "0 5px" }}>
                Confirm Password
              </label>
              <input
                type={showConfirmPassword ? "text" : "password"}
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
                style={{ width: "100%", padding: "10px", border: "1px solid transparent", borderRadius: "10px", outline: "none", backgroundColor: "#f8f8f8", transition: "all 0.3s ease", ...(focus.confirmPassword && { border: "1px solid #C1B857", boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)", backgroundColor: "#fff" }) }}
                onFocus={() => setFocus({ ...focus, confirmPassword: true })}
                onBlur={() => setFocus({ ...focus, confirmPassword: false })}
              />
              <button type="button" onClick={() => setShowConfirmPassword(!showConfirmPassword)} style={{ position: "absolute", right: "10px", top: "50%", transform: "translateY(-50%)", background: "none", border: "none", cursor: "pointer" }}>
                {showConfirmPassword ? "Hide" : "Show"}
              </button>
            </div>

            {/* Submit Button */}
            <div style={{ textAlign: "center", marginBottom: "20px" }}>
              <button type="submit" style={{ backgroundColor: "#C1B857", color: "white", padding: "10px 20px", borderRadius: "5px", fontSize: "1rem", border: "none" }} disabled={loading}>
                {loading ? "Registering..." : "Register"}
              </button>
            </div>

            {/* Social Media Buttons */}
            <div style={{ textAlign: "center", marginBottom: "20px" }}>
              <button style={{ backgroundColor: "#3b5998", color: "white", padding: "10px 20px", borderRadius: "5px", fontSize: "1rem", border: "none", margin: "5px" }}>
                Sign up with Facebook
              </button>
              <button style={{ backgroundColor: "#dd4b39", color: "white", padding: "10px 20px", borderRadius: "5px", fontSize: "1rem", border: "none", margin: "5px" }}>
                Sign up with Google
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default SignUpForm;
